import "./App.css";
import Dashboard from "./components/Dashboard";
import Navbar from "./components/Navbar/Navbar";
import axios from "axios";
import {
  BrowserRouter as Router,
  Route,
  Routes,
  Switch,
} from "react-router-dom";

function App() {
  axios.defaults.baseURL = "http://localhost:3000";

  return (
    <div className="App">
      <Navbar />
      <Dashboard />
    </div>
  );
}

export default App;
